  [],\n\t\"revision_timestamp\": \"2015-12-24T13:06:23.858573\",\n\t\"name\": \"hawaiian-islands-national-wildlife-refuge-disease-contingency-plan\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this plan is to provide
  a framework for response to disease outbreaks in migratory and endangered birds
  of Hawaiian Islands NWR. Implementation of this plan is intended to prevent the
  establishment of new or exotic diseases as diseases in native bird populations,
  reduce losses of birds through disease, diminish impact of disease outbreaks on
  endangered or threatened species and reduce the potential for the spread of contagious
  diseases from one population to another. The plan provides background on the Hawaiian
  Islands NWR, established notification procedure, and outlines necessary and available
  equipment and facilities for use in combating major bird disease problems on the
  Hawaiian Islands NWR. The plan establishes protocol for the early detection and
  orderly response to onsite wildlife morality. These actions are necessary for reducing
  disease spread and costs associated with control of major disease outbreaks. This
  plan was developed as a practical working document and will be updated so as to
  be current.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
